import requests
import asyncio
import aiohttp

class DexTrade:
    def __init__(self):
        self.headers = {"Content-Type": "application/json"}
        self.pair = "BTCUSDT"
        self.urlMarkets = "https://api.dex-trade.com/v1/public/symbols"
        self.urlOrderbooks = f"https://api.dex-trade.com/v1/public/book?pair="
        self.markets = {}

    def get_markets(self):
        markets = requests.get(url=self.urlMarkets, headers=self.headers).json()
        for market in markets['data']:
            if 'USD' in market['pair']:
                coin = market['pair'].split('USD')[0]
                self.markets.update({coin: market['pair']})
        return (self.markets)
        # return(markets)

    async def get_orderbook(self, symbol):
        async with aiohttp.ClientSession() as session:
            async with session.get(self.urlOrderbooks + symbol) as response:
                ob = await response.json()
                # print(ob)
        return {"top_ask": ob["data"]["sell"][0]['rate'], "top_bid": ob["data"]["buy"][0]['rate']}

dextrade = DexTrade()
markets = dextrade.get_markets()
print(markets)

async def main():
    orderbook = DexTrade()
    result = await orderbook.get_orderbook('BTCUSDT')
    print(result)

if __name__ == "__main__":
    asyncio.run(main())

